import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./App.css";
import Home from "./Components/Home";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route to="/" exact component={Home} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
